import React from "react";
import './index.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMagnifyingGlass, faBagShopping, faUser } from '@fortawesome/free-solid-svg-icons';

const Nav = () => {
    return (
        <nav class="w-full h-32 bg-gray-200 no-underline">
            <label class="font-extrabold w-full text-left size-64 ">FlavZ</label>
            <ul>
                <li><a href="/">Recipies</a></li>
                <li><a href="/">About Us</a></li>
                <li><a href="/">Contact</a></li>
            </ul>
            <ul>
                <li><a href="#"><FontAwesomeIcon icon={faMagnifyingGlass} /></a></li>
                <li><a href="#"><FontAwesomeIcon icon={faBagShopping} /></a></li>
                <li><a href="#"><FontAwesomeIcon icon={faUser} /></a></li>
            </ul>
        </nav>
    );
}

export default Nav;
